import React from "react";
import { Breadcrumb, BreadcrumbItem } from "reactstrap";
import { Link } from "react-router-dom";
import { withGoogleSheets } from "react-db-google-sheets";

function SingleSheet(props) {
	return (
		<div>
			<table className="table">
				<thead>
					<tr>
						<th>id</th>
						<th>name</th>
						<th>email</th>
					</tr>
				</thead>
				<tbody>
					{props.db.samplesheet.map((data) => (
						<tr key={data.discordId}>
							<td>{data.discordTag}</td>
							<td>{data.playerId}</td>
						</tr>
					))}
				</tbody>
			</table>
			<button className="btn btn-primary" onClick={props.refetch}>
				Refresh
			</button>
		</div>
	);
}

// function LoadRoster () {
//   doc.useApiKey('AIzaSyBetrWCd01ato3MjH7cRSfnc-vecg56_os');
// }

function Roster(props) {
	return (
		<div className="container main">
			<div className="row">
				<div className="col">
					<Breadcrumb>
						<BreadcrumbItem>
							<Link to="/home">Home</Link>
						</BreadcrumbItem>
						<BreadcrumbItem active>Roster</BreadcrumbItem>
					</Breadcrumb>
					<h2>Roster</h2>
					<hr />
          <SingleSheet />
				</div>
			</div>
			<div className="row row-content">
				<div className="col"></div>
			</div>
		</div>
	);
}

export default withGoogleSheets("Activity")(Roster);
